// src/pages/Start.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

const Start = () => {
  const navigate = useNavigate();

  return (
    <div className="relative h-screen bg-[#FDE8E9] overflow-hidden">
      {/* Background */}
      <div className="absolute inset-0">
        <img
          src="/images/bg_page1.png"
          alt="Background"
          className="object-cover w-full h-full"
        />
      </div>

      {/* Main Content Container */}
      <div className="relative h-full flex flex-col justify-between items-center px-2 py-4">
        {/* Image Container with oval shape */}
        <div className="w-full max-w-lg mx-auto mt-10">
          <div className="relative w-full aspect-[3/4] max-w-[400px] mx-auto">
            <div className="absolute inset-0 rounded-[45%] overflow-hidden">
              <img
                src="/images/pic_page1.png"
                alt="Lips"
                className="object-cover w-full h-full"
              />
            </div>
          </div>
        </div>

        {/* Text Container */}
        <div className="text-center mt-0">
          <h1 className="text-5xl md:text-7xl font-playfair font-serif italic text-rose-500 tracking-wider">
            FIND YOUR
          </h1>
          <h1 className="text-5xl md:text-7xl font-playfair font-serif italic text-rose-500 tracking-wider">
            RIGHT SHADE
          </h1>
        </div>

        {/* Button Container */}
        <div className="mt-8 mb-10">
          <button 
            onClick={() => navigate('/analyze')}
            className="font-serif italic bg-rose-500 hover:bg-rose-600 text-white text-xl px-12 py-6 rounded-full"
          >
            Get Started
          </button>
        </div>
      </div>
    </div>
  );
};

export default Start;
